import React from "react";
import "../styles/Resume.css";

const Resume = () => {
  return (
    <div className="resume">
      <h1>Resume</h1>
      <a href="/resume.pdf" download className="download-btn">
        Download Resume
      </a>
    </div>
  );
};

export default Resume;
